<script>
/* Minimal reader. No debug. Polls per-room keys and toggles classes on *_Room nodes. */
const WEBDIS  = new URLSearchParams(location.search).get('wd')     || 'http://192.168.30.114:7379';
const PREFIX  = new URLSearchParams(location.search).get('prefix') || 'rpg2025_room_';
const INTERVAL= Math.max(1, parseInt(new URLSearchParams(location.search).get('interval')||'2',10));

const svg = document.querySelector('svg');

async function jget(parts){
  const base = WEBDIS.replace(/\/$/,'');
  const url  = base + '/' + parts.map(encodeURIComponent).join('/');
  const r = await fetch(url, {cache:'no-store'});
  if(!r.ok) throw new Error(`HTTP ${r.status}`);
  return r.json();
}
async function keys(match){
  // KEYS fallback is simplest and your DB is tiny
  const j = await jget(['KEYS', match]);
  let v = j.KEYS || j.keys;
  if(Array.isArray(v)) return v;
  if(v && typeof v==='object') return Object.values(v).filter(x=>typeof x==='string');
  return [];
}
async function getVal(key){
  const j = await jget(['GET', key]);
  return j.GET ?? j.get ?? null;
}
async function poll(){
  try{
    const ks = await keys(PREFIX + '*');
    for(const k of ks){
      const state = await getVal(k); // 'ok' | 'fire' | 'breach' | null
      const id = k.slice(PREFIX.length);
      const el = svg.getElementById(id);
      if(!el) continue;
      const onFire   = state === 'fire';
      const breached = state === 'breach';
      el.classList.toggle('breach-on', breached);
      el.classList.toggle('fire-on', onFire && !breached);
      if(state === 'ok' || state == null) el.classList.remove('breach-on','fire-on');
    }
  }catch(_){/* silent */}
}
poll();
setInterval(poll, INTERVAL*1000);
</script>
